import { Link } from "react-router-dom";

const CourseView = (props) => {
  const { course } = props;

  //only
  if(course.instructor.id==null){
    return (
      <div>
        <h1>{course.title}</h1>
        <h2>Timeslot:{course.timeslot}</h2>
        <h3>Location:{course.location}</h3>
        {course.instructor ? <h3>{course.instructor.firstname + " " + course.instructor.lastname}</h3>: <h3>staff</h3>}
      </div>
    );
  }

  else{

  return (
    <div>
      <h1>{course.title}</h1>
      <h2>Timeslot:{course.timeslot}</h2>
      <h3>Location:{course.location}</h3>
      <Link to={`/instructor/${course.instructor.id}`}></Link>
      {course.instructor ? <h3>{course.instructor.firstname + " " + course.instructor.lastname}</h3>: <h3>staff</h3>}
    </div>
  );
  };

};

export default CourseView;
